import React from "react";
import PropTypes from "prop-types";

const InputForm = ({ outerName, suggestedName }) => {
  return (
    <>
      <div className="border mt-4 text-white bg-transparent">{outerName}</div>
      {/* Name (inside the form) */}
      <div className="mt-4">
        <input
          type="text"
          placeholder={suggestedName}
          className="w-full p-2 text-white bg-transparent"
        />
      </div>
    </>
  );
};

InputForm.propTypes = {
  outerName: PropTypes.string.isRequired,
  suggestedName: PropTypes.string.isRequired,
};
export default InputForm;
